# React # React Native # React Native Flament # React Native Flament Location

In React Native Flament, you can use the `FLamentLocation` component to track the user's location without their consent. Here is an example of how you can use the `FLamentLocation` component in React Native Flament:
```
import React, { useState } from 'react';
import FLamentLocation from 'react-native-flament-location';

function App() {
  const [location, setLocation] = useState(null);

  return (
    <FLamentLocation
      onLocationChange={(location) => {
        setLocation(location);
      }}
      onLocationChangeWithoutUserLocation={(location) => {
        setLocation(location);
      }}
    />
  );
  return (
    <View>
      <FLamentLocation
        onLocationChange={(location) => {
          console.log(location);
        }}
        onLocationChangeWithoutUserLocation={(location) => {
          console.log('User location: ' + location);
        }}
      />

